import React from "react";
interface CustomLogoProps {
  name: string;
}

export const CustomLogo = ({ name }: CustomLogoProps) => {
  switch (name) {
    case "logo":
      return (
        <div className="">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            height="48"
            width="80"
            fill="none"
          >
            <rect width="100%" height="100%"/>
            <image
              href="data:image/png;base64,"
              x="0"
              y="0"
              width="50"

            />
          </svg>
        </div>
      );
    default:
      return <div className="">Not founded</div>;
  }
};
